import logo from './logo.svg';
// Components
import About from './component/About';
import Cube from './component/Cube';
import Point from './component/Points';
import CsvReader from './component/Csv';
import './App.css';
import React from 'react';

const pythonExec =() => {
  const python_code = 
    print("hello")
  ;
  const pyodide = window.pyodide;
  pyodide.runPython(python_code)

}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
        <About></About>
      </header>
      {/* create a form for the user to select a file */}
      <button onClick={pythonExec}>Click</button>
      <CsvReader></CsvReader>
      <div><canvas id="Threejs"></canvas></div>

    </div>
  );
}
export default App;
